import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-91a0dcfbf2e93",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\README.md").then(comp => {
        Vue.component("v-91a0dcfbf2e93", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-d52a6888b6d64",
    path: "/js/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\js\\README.md").then(comp => {
        Vue.component("v-d52a6888b6d64", comp.default)
        next()
      })
    }
  },
  {
    path: "/js/index.html",
    redirect: "/js/"
  },
  {
    name: "v-db1c431a15851",
    path: "/technical/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\technical\\README.md").then(comp => {
        Vue.component("v-db1c431a15851", comp.default)
        next()
      })
    }
  },
  {
    path: "/technical/index.html",
    redirect: "/technical/"
  },
  {
    name: "v-84dc54f9a4e2e",
    path: "/vue/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\vue\\README.md").then(comp => {
        Vue.component("v-84dc54f9a4e2e", comp.default)
        next()
      })
    }
  },
  {
    path: "/vue/index.html",
    redirect: "/vue/"
  },
  {
    name: "v-53724eabd719",
    path: "/vue/framwork.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\practiceProject\\blog\\my-blog\\docs\\vue\\framwork.md").then(comp => {
        Vue.component("v-53724eabd719", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
